import React from 'react';
import { BrowserRouter as Router, Routes, Route, useParams, useLocation } from 'react-router-dom';
import Home from '../Index'; 
import Shop from '../Shop'; 
import Login from '../Login/Login'; 
import Register from '../Login/Register'; 
import Logout from '../Login/Logout'; 
import Cart from '../Product/AddToCart'; 
import Data from '../Productshow'; 
import Order from '../Product/Order'; 
import SearchResults from '../Search'; // Import the new search results page

function App() {
  const { categoryId } = useParams();
  const location = useLocation(); // Access the current URL location

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} /> 
        {/* Route for Search with query parameter */}
        <Route path="/search" element={<SearchResults />} /> 
        <Route path="/login" element={<Login />} /> 
        <Route path="/register" element={<Register />} /> 
        <Route path="/logout" element={<Logout />} /> 
        <Route path="/shop" element={<Shop />} />
        <Route path="/shop/:categoryId" element={<Shop categoryId={categoryId} />} />
        <Route path="/cart/:id" element={<Cart />} />
        <Route path="/order/:id" element={<Order />} />
        <Route path="/product/:id" element={<Data />} />
      </Routes>
    </Router>
  );
}

export default App;
